import 'package:dio/dio.dart';import 'package:flutter_hive_database/core/constant/constants.dart';import 'package:flutter_hive_database/model/user_response.dart';import 'package:flutter_hive_database/service/client_service.dart';class  UserService{  Future<dynamic>  getUsers() async{    try {      Response response = await DioClient().get('user/me');       if(response.statusCode==200){         print(response.data);         return  response.data  as Map<String, dynamic>;       }    } catch(e){        print(e);    }  }}